import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Accueil from './pages/Accueil';

function App() {
  return (
    <Router>

      <Route exact path="/" component={Accueil} />

    </Router>
  );
}

export default App;
